It was found in [4] that the eigenvalues of perp states are given by the following:

\[
\lambda(\rho) = 
\begin{cases}
1 + c_p \pm \sqrt{\sum_{\text{pos}} (c_{i1} + c_{i2})^2 + \sum_{\text{neg}} (c_{i1} - c_{i2})^2} \\
1 - c_p \pm \sqrt{\sum_{\text{pos}} (c_{i1} - c_{i2})^2 + \sum_{\text{neg}} (c_{i1} + c_{i2})^2}
\end{cases}
\tag{6}
\]

where \( c_p \) is the coefficient associated to the point \( p \), \( c_{i1}, c_{i2} \) are colinear coefficients sharing the \( i \)th context with \( p \), and the sums are taken over positive and negative lines as defined by the operator products.

We now split the coefficients into two types: ones associated to the fully nontrivial points in \( G_2 \), which we label \( \beta_{ij} \), and the rest, which we label \( \tau_{ij} \). It is easy to see that for a point \( p \notin G_2 \), its incident lines contain one operator within \( G_2 \) and one outside it. Also, all of these contexts are positive, as the only negative lines are fully contained in \( G_2 \). Thus for a semi-trivial perp state we can label the eigenvalues as such:

\[
\lambda(\rho) =
\begin{cases}
1 + \tau_p \pm \sqrt{ \sum_{i=1}^3 (\beta_i + \tau_i)^2 } \\
1 - \tau_p \pm \sqrt{ \sum_{i=1}^3 (\beta_i - \tau_i)^2 }
\end{cases}
\tag{7}
\]

We let the \( \tau_i, i = 1,2,3 \) coefficients be coordinates of a point \( C \) in 3-dimensional parameter space \( S \). We let the coordinates \( \beta_i, i = 1,2,3 \) define a point \( E \) which we call the state point. The distance \( r_\pm := 1 \pm \tau_p \) define radii of spheres centred at the point \( C \), which we call \( (C, r_\pm) \). Then positive definiteness becomes a condition on the coordinates of the points:

\textbf{Proposition 2.1.} \textit{The semi-trivial perp state \( \rho \) is positive-semidefinite iff the state point \( E \) and its reflected point \( -E \) are contained on the surface or in the interior of the spheres \( (C, r_+) \), \( (C, r_-) \) respectively.}

This is proven in [4], but is evident upon inspection of the eigenvalues. What's more, the eigenvalues are dependent upon the radii \( r_\pm \) and the distances \( |\pm E, C| \), so under translations and rotations of the parameter space \( S \), any eigenvalue-dependent property such as positive-definiteness is unchanged. Therefore for any perp state \( \rho \) we are free to form a state \( R(\rho) \) by rotating the parameters in \( S \) by some rotation \( R \), then \( \rho \) and \( R(\rho) \) will have the same positive-definite property.

